import "bootstrap/dist/css/bootstrap.min.css";

function NewSeries() {
  return (
    <body>
      <h1>New Series</h1>
      <p>This is information about the author's upcoming series</p>

      <footer>&#169; AuthorName 2024</footer>
    </body>
  );
}

export default NewSeries;
